$("td.lim > button").each(function( index ) {
    $( this ).attr({
    "class" : "icon-alert-info-reverse icon_alert_color popover_trigger",
    "data-popoverid" : "lim" + index,
    "data-toggle": "popover",
    "data-html": "true"
  }).removeAttr("style");
});

$(function () {
  $('[data-toggle="popover"]').popover()

  var selected_popover;

    $('[data-toggle="popover"]').on('shown.bs.popover', function () {
      selected_popover = this.getAttribute("data-popoverid");
      selected_popover = '[data-popoverid="' + selected_popover + '"]';
    });

    $(document).keyup(function(e) {
      if (e.keyCode === 27) {
        $(selected_popover).popover('hide');
        $(selected_popover).one('hidden.bs.popover', function () {
          $(selected_popover).focus();
          selected_popover = null;
        });
      }
    });

    $('body').on('click', function() {
      if (selected_popover) {
        $(selected_popover).popover('hide');
        selected_popover = null;
      }
    });
  });
